    "script": "\nDROP DATABASE IF EXISTS testdb12283; CREATE DATABASE testdb12283; \n//Create Table\nCREATE TABLE testdb12283.dbo.testtbl12422\n(\n        //Define schema of table\n        UserId          int, \n        Start           DateTime, \n        Region          string, \n        Query           string, \n        Duration        int, \n        Urls            string, \n        ClickedUrls     string,\n    INDEX idx1 //Name of index\n    CLUSTERED (Region ASC) //Column to cluster by\n    PARTITIONED BY HASH (Region) //Column to partition by\n);\nDROP FUNCTION IF EXISTS testdb12283.dbo.testtvf16583;\n\n//create table weblogs on space-delimited website log data\nCREATE FUNCTION testdb12283.dbo.testtvf16583()\nRETURNS @result TABLE\n(\n    s_date DateTime,\n    s_time string,\n    s_sitename string,\n    cs_method string, \n    cs_uristem string,\n    cs_uriquery string,\n    s_port int,\n    cs_username string, \n    c_ip string,\n    cs_useragent string,\n    cs_cookie string,\n    cs_referer string, \n    cs_host string,\n    sc_status int,\n    sc_substatus int,\n    sc_win32status int, \n    sc_bytes int,\n    cs_bytes int,\n    s_timetaken int\n)\nAS\nBEGIN\n\n    @result = EXTRACT\n        s_date DateTime,\n        s_time string,\n        s_sitename string,\n        cs_method string,\n        cs_uristem string,\n        cs_uriquery string,\n        s_port int,\n        cs_username string,\n        c_ip string,\n        cs_useragent string,\n        cs_cookie string,\n        cs_referer string,\n        cs_host string,\n        sc_status int,\n        sc_substatus int,\n        sc_win32status int,\n        sc_bytes int,\n        cs_bytes int,\n        s_timetaken int\n    FROM @\"/Samples/Data/WebLog.log\"\n    USING Extractors.Text(delimiter:' ');\n\nRETURN;\nEND;\nCREATE VIEW testdb12283.dbo.testview13345 \nAS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \nAS \nT(a, b);\nCREATE PROCEDURE testdb12283.dbo.testproc17419()\nAS BEGIN\n  CREATE VIEW testdb12283.dbo.testview13345 \n  AS \n    SELECT * FROM \n    (\n        VALUES(1,2),(2,4)\n    ) \n  AS \n  T(a, b);\nEND;",
